import { useState } from "react";
import axios from "axios";

import "./App.css";

function App() {
  const [searchedCpf, setSearchedCpf] = useState("");
  const [posts, setPosts] = useState([]);

  const handleSearch = async () => {
    try {
      // Validate CPF input (optional)

      const response = await axios.get(`/questions/cpf/${searchedCpf}`);

      setPosts(response.data); // Update state with fetched data
    } catch (error) {
      console.error(error);
      alert("Error fetching data! Please try again later."); // Improved error message
    }
  };

  return (
    <div className="App">
      <div className="Colum">
        <div className="cont">
          <center>
            <h2>Selecionar Pergunta</h2>
          </center>
          <input
            type="text"
            placeholder="Enter CPF"
            onChange={(e) => setSearchedCpf(e.target.value)}
          />
          <div>
            {posts.length > 0 ? (
              <div>
                {posts.map((post) => (
                  <div key={post._id}>
                    <p>{post.pergunta}</p>
                    <p>
                      {post.infoPaciente.map((info) => (
                        <p key={info.cpf}>
                          {info.cpf}: {info.otherInfo}
                        </p>
                      ))}
                    </p>
                  </div>
                ))}
              </div>
            ) : (
              <p>No perguntas found for this CPF.</p>
            )}
          </div>
          <button onClick={handleSearch}>Search</button>
        </div>
      </div>
    </div>
  );
}

export default App;
